package com.example.auta.domain.entities;import lombok.*;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.util.*;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class CompanyEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUIDGenerator")    private UUID id;    private String name;    private String domain;    private String address;    private String owner;    private byte[] logotype;    @Builder.Default    @OneToMany(cascade = CascadeType.PERSIST, orphanRemoval = true)    @JoinColumn(name="company_id")    @EqualsAndHashCode.Exclude @ToString.Exclude    private Set<BranchEntity> branches = new HashSet();}